(\"#comentarios_bloque\").html());$(\"#container_text\").printArea();}</script><div id=\"container_text\" style=\"display:none;\">    <div id=\"antetitulo_oculto\">JaÃ©n | Universidad</div>    <div id=\"imagen_oculto\" style=\"margin-bottom:20px\">    \t\t\t<img src=\"http://andaluciainformacion.es/cms/media/articulos/articulos-129919.jpg\" width=\"400\" />\t    </div>    <div id=\"titulo_oculto\" style=\"font-size:28px; line-height:32px\">La UJA no descarta el curso 2013-14 para Medicina</div>    <div id=\"datos_oculto\">Aurora GuzmÃ¡n / Agencias &middot;  12/06/2012 21:37</div>    <div id=\"texto_oculto\"><p> El curso 2013-2014 es el propuesto para iniciar la implantaci&oacute;n del Grado de Medicina en la Universidad de Ja&eacute;n (UJA). As&iacute; lo ha aclarado el rector de la UJA, Manuel Parras, asegurando que&nbsp; los plazos de tiempo son &ldquo;apurados&rdquo;.</p> <p> En la actualidad, la Comisi&oacute;n&nbsp; trabaja&nbsp; en el dise&ntilde;o de modelo de titulaci&oacute;n y conf&iacute;a en poder en enviar a la a la Agencia Nacional de Evaluaci&oacute;n de la Calidad y Acreditaci&oacute;n (Aneca) la memoria de verificaci&oacute;n&nbsp; antes de que acabe este a&ntilde;o.</p> <p> Parras asegura que se quiere crear un Grado de Medicina &ldquo;muy vinculado a los buenos&nbsp; profesionales que ejercen en Ja&eacute;n y su &aacute;rea m&aacute;s cercana&rdquo;.</p> <p> Por otra parte, ha considerado que el retraso que sufre el futuro edificio de I+D+i, TIC y emprendimiento que debe levantarse en el campus universitario de Las Lagunillas y que albergar&iacute;a la Facultad de Medicina (por lo menos durante los primeros cursos, a la espera de la construcci&oacute;n de una sede espec&iacute;fica) no tiene por qu&eacute; ser un obst&aacute;culo.</p> <p> A este respecto, el rector aclara que &ldquo;en sus inicios se puede hacer en instalaciones de la Universidad ya existentes y en centros hospitalarios de la provincia en tanto queremos un tipo de Medicina vinculado a los profesionales, muy buenos, con los que cuenta el sistema sanitario jienense&rdquo;.</p> <p> Por todo ello, Parras Rosa no cambia las estimaciones de echar a andar el primer curso del Grado de Medicina en 2013-14, uno despu&eacute;s de lo que en un principio se hab&iacute;a apuntado.</p> <p> Y es que no es una situaci&oacute;n f&aacute;cil. El rector asegura al respecto,&nbsp; que se trata de un asunto &ldquo;complejo&rdquo;, puesto que, adem&aacute;s, es la primera vez que la Universidad jiennense remitir&aacute; una memoria de verificaci&oacute;n de Medicina. Ante estas circunstancias, Manuel Parras recuerda que las acciones necesarias presentan sus tr&aacute;mites y plazos correspondientes. &ldquo;Seguimos proponiendo esa fecha, aunque vamos apurados&quot;, ha reconocido el rector.</p>     </div>    <div id=\"comentarios_titulo_oculto\">Comentarios:</div>    <div id=\"comentarios_oculto\">    </div></div><style>.simplePagerNav a{\tcolor:#666 !important;}</style><div class=\"wrap-centro\"><div class=\"pagina-completa\"><div class=\"blanco-pagina\"><!-- INICIO ID 374 --><div class=banner-izquierda><script type=\"text/javascript\"><!--\rgoogle_ad_client = \"ca-pub-0998692745552493\";\r/* Skycraper ancho 160x600 */\rgoogle_ad_slot = \"8606871943\";\rgoogle_ad_width = 160;\rgoogle_ad_height = 600;\r//-->\r</script>\r<script type=\"text/javascript\"\rsrc=\"http://pagead2.googlesyndication.com/pagead/show_ads.js\">\r</script></div><!-- FIN ID 374 --><!-- INICIO ID 374 --><div class=banner-derecha><script type=\"text/javascript\"><!--\rgoogle_ad_client = \"ca-pub-0998692745552493\";\r/* Skycraper ancho 160x600 */\rgoogle_ad_slot = \"8606871943\";\rgoogle_ad_width = 160;\rgoogle_ad_height = 600;\r//-->\r</script>\r<script type=\"text/javascript\"\rsrc=\"http://pagead2.googlesyndication.com/pagead/show_ads.js\">\r</script></div><!-- FIN ID 374 --><!------ ZONA ARTICULO ------------------><div class=\"grid_12 alpha\"><!---------- COLUMNA - IZQUIERDA --------><div cl